    "\n",
    "ddpg = DDPG(env, gru = model, I_max = 10,\n",
    "            gamma = 0.999, \n",
    "            lr= 0.001,\n",
    "            n_nodes=16, n_layers=5, \n",
    "            name=\"test\" )"
